import React from "react";

export default function Bill({ info }) {
    const formattedDate = info.date.substring(0, 10);
    return (
        <div className = "">

            <h3>{formattedDate}</h3>
            <h3>Amount: {info.amount}</h3>
            <p>{info.hospital}</p>
            <p>{info.patient}</p>
            <p>{info.address}</p>
            {/* Render additional bill information here */}
        </div>
    );
}
